import classes from "./Quiz.module.css";
import Slider from '@mui/material/Slider';

// const quizContainer = document.getElementById("quiz");
// const resultsContainer = document.getElementById("results");
// const submitButton = document.getElementById("submit");

// slider.oninput = function () {
//   output.innerHTML = this.value;
// };

function buildSlider() {
  return (
    <div className={classes.slidecontainer}>
      <input type="range" min="1" max="10" value="5" id="myRange" />
    </div>
  );
}

function buildQuiz() {
  console.log("Building Quiz");
}

function submitQuiz() {
  <div>{console.log("submit quiz")}</div>;
}
// on submit, show results
//submitButton.addEventListener("click", submitQuiz);
//test
export default function QuizPage() {
  return (
    <div id="quiz">
      <Slider
        size="small"
        defaultValue={70}
        aria-label="Small"
        valueLabelDisplay="auto"
      />
      <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
      <li>
        <ul>What color would you like your wine?</ul>
        <ul>How expensive?</ul>
        <ul>How sweet?</ul>
        <ul>What Year?</ul>
        <ul>Region? (cuntry)</ul>
      </li>
      <button id="submit" onClick={submitQuiz()}>
        Submit
      </button>
      <p>
        Value: <span id="demo"></span>
      </p>
    </div>
  );
}
